"use client";

import React, { useState } from "react";

// Assuming your custom components (Button, Card, Input, Label, Select, etc.) are imported here.
// If you have them in your project, import them properly; otherwise, you need to define or import these components.

// Below is an example definition for Button and Card; replace with your actual imports

const Button = ({ children, ...props }) => (
    <button
        {...props}
        className={`inline-flex items-center justify-center rounded-md text-sm font-medium transition-colors 
                focus-visible:outline-none focus-visible:ring-2 focus-visible:ring-ring focus-visible:ring-offset-2 
                disabled:opacity-50 disabled:pointer-events-none ring-offset-background 
                bg-gradient-to-r from-blue-600 to-green-500 hover:from-blue-700 hover:to-green-600 text-white px-4 py-2`}
    >
        {children}
    </button>
);

const Card = ({ children }) => (
    <div className="rounded-lg border border-gray-700 bg-gray-800 text-white shadow-md p-6">{children}</div>
);

const CardHeader = ({ children }) => <div className="mb-4">{children}</div>;
const CardTitle = ({ children }) => <h3 className="text-xl font-semibold">{children}</h3>;
const CardContent = ({ children }) => <div>{children}</div>;

const Label = ({ children, htmlFor }) => (
    <label htmlFor={htmlFor} className="block mb-1 font-medium text-gray-200">
        {children}
    </label>
);

const Input = ({ className = "", ...props }) => (
    <input
        {...props}
        className={`w-full rounded-md border border-gray-600 bg-gray-900 px-3 py-2 text-white text-sm 
               focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent ${className}`}
    />
);

const Select = ({ children, ...props }) => (
    <select
        {...props}
        className="w-full rounded-md border border-gray-600 bg-gray-900 px-3 py-2 text-white text-sm 
               focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
    >
        {children}
    </select>
);

const Textarea = ({ className = "", ...props }) => (
    <textarea
        {...props}
        className={`w-full rounded-md border border-gray-600 bg-gray-900 px-3 py-2 text-white text-sm resize-vertical 
               focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent ${className}`}
    />
);

// Example icons (replace with your lucide-react or icon library)
const GraduationCap = () => <span className="inline-block mr-1">🎓</span>;
const UserCheck = () => <span className="inline-block mr-1">✅</span>;
const Users = () => <span className="inline-block mr-1">👥</span>;
const Settings = () => <span className="inline-block mr-1">⚙️</span>;
const Trash2 = () => <span className="inline-block text-red-500">🗑️</span>;

const Badge = ({ children, className = "" }) => (
    <span
        className={`inline-block rounded-full bg-green-600 bg-opacity-30 px-2 py-0.5 text-xs font-semibold text-green-400 ${className}`}
    >
        {children}
    </span>
);

// Main Component
export default function DepartmentDashboard() {
    const [activeTab, setActiveTab] = useState("students");
    const [users, setUsers] = useState([]);
    const [loading, setLoading] = useState(false);
    const [message, setMessage] = useState({ type: "", text: "" });

    const [studentForm, setStudentForm] = useState({
        firstName: "",
        lastName: "",
        email: "",
        password: "",
        usn: "",
        department: "",
        semester: "",
        phoneNumber: "",
        address: "",
    });

    const departments = [
        "COMPUTER SCIENCE",
        "INFORMATION SCIENCE",
        "ELECTRONICS",
        "MECHANICAL",
        "CIVIL",
        "ELECTRICAL",
        "MCA",
        "MCom",
        "MBA",
        "BCA",
        "BCom",
    ];

    const semesters = ["1", "2", "3", "4", "5", "6", "7", "8"];

    // Helper
    const showMessage = (type, text) => {
        setMessage({ type, text });
        setTimeout(() => setMessage({ type: "", text: "" }), 5000);
    };

    const handleStudentSubmit = (e) => {
        e.preventDefault();
        setLoading(true);

        setTimeout(() => {
            try {
                const newUser = {
                    id: Date.now(),
                    userId: studentForm.usn,
                    email: studentForm.email,
                    firstName: studentForm.firstName,
                    lastName: studentForm.lastName,
                    department: studentForm.department,
                    semester: studentForm.semester,
                    phoneNumber: studentForm.phoneNumber,
                    address: studentForm.address,
                    userType: "STUDENT",
                    createdAt: new Date().toISOString(),
                };
                setUsers((prev) => [...prev, newUser]);
                showMessage("success", `Student created successfully! USN: ${newUser.userId}`);
                setStudentForm({
                    firstName: "",
                    lastName: "",
                    email: "",
                    password: "",
                    usn: "",
                    department: "",
                    semester: "",
                    phoneNumber: "",
                    address: "",
                });
            } catch (error) {
                showMessage("error", "Error creating student account");
            } finally {
                setLoading(false);
            }
        }, 1000);
    };

    // Filter users by active tab
    const filteredUsers = users.filter((user) => {
        if (activeTab === "students") {
            return user.userType === "STUDENT";
        }
        return false;
    });

    return (
        <div className="min-h-screen bg-gradient-to-br from-slate-900 via-blue-900 to-slate-900 p-6">
            {/* Header */}
            <header className="border-b border-slate-700 bg-slate-900/95 backdrop-blur-sm mb-8">
                <div className="container mx-auto px-4 py-4 flex items-center justify-between">
                    <div className="flex items-center space-x-4">
                        <div className="flex h-12 w-12 items-center justify-center rounded-full bg-gradient-to-r from-blue-500 to-green-500 text-white font-bold">
                            DSCE
                        </div>
                        <div>
                            <h1 className="text-xl font-bold text-white">Department Admin Panel</h1>
                            <p className="text-sm text-slate-400">Manage Users & Credentials</p>
                        </div>
                    </div>
                    <Button variant="destructive" onClick={() => (window.location.href = "/")}>
                        Logout
                    </Button>
                </div>
            </header>

            {/* Message */}
            {message.text && (
                <div
                    className={`mb-6 border rounded-lg p-4 ${message.type === "success" ? "border-green-500 bg-green-500/10 text-green-400" : "border-red-500 bg-red-500/10 text-red-400"
                        }`}
                >
                    {message.text}
                </div>
            )}

            {/* Tabs */}
            <div className="space-y-6 max-w-5xl mx-auto">
                <nav className="flex space-x-4 border-b border-slate-700">
                    <button
                        className={`py-2 px-4 -mb-px font-semibold border-b-2 ${activeTab === "students" ? "border-blue-500 text-blue-400" : "border-transparent hover:text-blue-300"
                            }`}
                        onClick={() => setActiveTab("students")}
                    >
                        <GraduationCap /> Students
                    </button>
                    {/* Add similar buttons for teachers/admins if needed */}
                </nav>

                {activeTab === "students" && (
                    <section>
                        {/* Add Student Form */}
                        <Card className="mb-6">
                            <CardHeader>
                                <CardTitle>
                                    <GraduationCap /> Add New Student
                                </CardTitle>
                            </CardHeader>
                            <CardContent>
                                <form onSubmit={handleStudentSubmit} className="space-y-4">
                                    <div className="grid grid-cols-1 sm:grid-cols-2 gap-4">
                                        <div>
                                            <Label htmlFor="firstName">First Name</Label>
                                            <Input
                                                id="firstName"
                                                type="text"
                                                value={studentForm.firstName}
                                                onChange={(e) => setStudentForm({ ...studentForm, firstName: e.target.value })}
                                                placeholder="Enter first name"
                                                required
                                            />
                                        </div>
                                        <div>
                                            <Label htmlFor="lastName">Last Name</Label>
                                            <Input
                                                id="lastName"
                                                type="text"
                                                value={studentForm.lastName}
                                                onChange={(e) => setStudentForm({ ...studentForm, lastName: e.target.value })}
                                                placeholder="Enter last name"
                                                required
                                            />
                                        </div>
                                    </div>
                                    <div className="grid grid-cols-1 sm:grid-cols-2 gap-4">
                                        <div>
                                            <Label htmlFor="email">Email Address</Label>
                                            <Input
                                                id="email"
                                                type="email"
                                                value={studentForm.email}
                                                onChange={(e) => setStudentForm({ ...studentForm, email: e.target.value })}
                                                placeholder="student@dsce.edu.in"
                                                required
                                            />
                                        </div>
                                        <div>
                                            <Label htmlFor="password">Password</Label>
                                            <Input
                                                id="password"
                                                type="password"
                                                value={studentForm.password}
                                                onChange={(e) => setStudentForm({ ...studentForm, password: e.target.value })}
                                                placeholder="Set student password"
                                                required
                                            />
                                        </div>
                                    </div>
                                    <div>
                                        <Label htmlFor="usn">USN (University Seat Number)</Label>
                                        <Input
                                            id="usn"
                                            type="text"
                                            value={studentForm.usn}
                                            onChange={(e) =>
                                                setStudentForm({ ...studentForm, usn: e.target.value.toUpperCase() })
                                            }
                                            placeholder="e.g., 1DS21CS001"
                                            required
                                        />
                                    </div>
                                    <div className="grid grid-cols-1 sm:grid-cols-2 gap-4">
                                        <div>
                                            <Label>Department</Label>
                                            <Select
                                                value={studentForm.department}
                                                onChange={(e) =>
                                                    setStudentForm({ ...studentForm, department: e.target.value })
                                                }
                                                required
                                            >
                                                <option value="">Select Department</option>
                                                {departments.map((dept) => (
                                                    <option key={dept} value={dept}>
                                                        {dept}
                                                    </option>
                                                ))}
                                            </Select>
                                        </div>
                                        <div>
                                            <Label>Semester</Label>
                                            <Select
                                                value={studentForm.semester}
                                                onChange={(e) =>
                                                    setStudentForm({ ...studentForm, semester: e.target.value })
                                                }
                                                required
                                            >
                                                <option value="">Select Semester</option>
                                                {semesters.map((sem) => (
                                                    <option key={sem} value={sem}>
                                                        Semester {sem}
                                                    </option>
                                                ))}
                                            </Select>
                                        </div>
                                    </div>
                                    <div className="grid grid-cols-1 sm:grid-cols-2 gap-4">
                                        <div>
                                            <Label htmlFor="phoneNumber">Phone Number</Label>
                                            <Input
                                                id="phoneNumber"
                                                type="tel"
                                                value={studentForm.phoneNumber}
                                                onChange={(e) => setStudentForm({ ...studentForm, phoneNumber: e.target.value })}
                                                placeholder="9876543210"
                                            />
                                        </div>
                                        <div>
                                            <Label htmlFor="address">Address</Label>
                                            <Textarea
                                                id="address"
                                                value={studentForm.address}
                                                onChange={(e) => setStudentForm({ ...studentForm, address: e.target.value })}
                                                placeholder="Enter student address"
                                                rows={3}
                                            />
                                        </div>
                                    </div>
                                    <Button type="submit" disabled={loading}>
                                        {loading ? "Creating..." : "Create Student Account"}
                                    </Button>
                                </form>
                            </CardContent>
                        </Card>

                        {/* Students List */}
                        <Card>
                            <CardHeader>
                                <CardTitle>
                                    <Users /> Students List ({filteredUsers.length})
                                </CardTitle>
                            </CardHeader>
                            <CardContent>
                                {filteredUsers.length === 0 ? (
                                    <p className="text-center text-gray-400 py-8">No students created yet.</p>
                                ) : (
                                    <div className="space-y-4 max-h-96 overflow-y-auto">
                                        {filteredUsers.map((user) => (
                                            <div
                                                key={user.id}
                                                className="bg-gray-700 rounded-lg p-4 border border-gray-600"
                                                role="region"
                                                aria-label={`Student ${user.firstName} ${user.lastName}`}
                                            >
                                                <div className="flex items-center justify-between mb-3">
                                                    <div className="flex items-center space-x-3">
                                                        <div className="flex h-10 w-10 items-center justify-center rounded-full bg-gradient-to-r from-blue-500 to-green-500 font-bold text-white">
                                                            <GraduationCap />
                                                        </div>
                                                        <div>
                                                            <h3 className="font-semibold">
                                                                {user.firstName} {user.lastName}
                                                            </h3>
                                                            <p className="text-sm text-gray-400">{user.email}</p>
                                                        </div>
                                                    </div>
                                                    <div>
                                                        <Button
                                                            variant="destructive"
                                                            size="sm"
                                                            onClick={() => {
                                                                if (
                                                                    window.confirm(
                                                                        `Are you sure you want to delete student ${user.firstName} ${user.lastName}?`
                                                                    )
                                                                ) {
                                                                    setUsers((prev) =>
                                                                        prev.filter((u) => u.id !== user.id)
                                                                    );
                                                                    showMessage("success", "Student deleted successfully.");
                                                                }
                                                            }}
                                                            disabled={loading}
                                                        >
                                                            <Trash2 /> Delete
                                                        </Button>
                                                    </div>
                                                </div>
                                                <div className="grid grid-cols-2 gap-2 text-sm">
                                                    <div>
                                                        <span className="text-gray-400">USN: </span>
                                                        <span>{user.userId}</span>
                                                    </div>
                                                    <div>
                                                        <span className="text-gray-400">Department: </span>
                                                        <span>{user.department || "N/A"}</span>
                                                    </div>
                                                    <div>
                                                        <span className="text-gray-400">Semester: </span>
                                                        <span>{user.semester ? `Semester ${user.semester}` : "N/A"}</span>
                                                    </div>
                                                    <div>
                                                        <span className="text-gray-400">Phone: </span>
                                                        <span>{user.phoneNumber || "N/A"}</span>
                                                    </div>
                                                </div>
                                            </div>
                                        ))}
                                    </div>
                                )}
                            </CardContent>
                        </Card>
                    </section>
                )}
            </div>
        </div>
    );
}
